Batman: The Dark Knight Returns - Part 2 (2013) (DVDRip - 480p)
---------------------------------------------------------------

The Dark Knight along with new sidekick Robin have finally reclaimed Gotham City
and allowed a ray of hope to penetrate the reign of terror that The Mutants had
cast upon his city. With Batman back in the spotlight the extended media coverage
has awoken a far worse evil at Arkham Asylum The Joker! Forever destined to be
mortal enemies The Joker has a diabolical scheme that may pull Batman down to the
darkest levels of insanity. While on the horizon a global catastrophe races towards
Gotham and with it comes a familiar face The Man of Steel though this time he has
Batman in his sights. Witness as the aging Dark Knight wages a tireless war against
crime while proving that courage and will are indeed timeless.

Produced by DC Entertainment and Warner Bros. Animation.

